INSERT INTO `products` VALUES (106,'Digital key','There are people who have forgotten their keys, the digital lock from the Ahram will solve this issue','<p>There are people who have forgotten their keys, the digital lock from the Ahram will solve this issue</p>',40,'2023-10-29 09:35:30','2023-10-29 09:35:30','مفتاح ديجيتال','فيه ناس على طول ناسية مفاتيحها، قفل الديجيتال من الأهرام هيحل ليك الموضوع ده.','<p>فيه ناس على طول ناسية مفاتيحها، قفل الديجيتال من الأهرام هيحل ليك الموضوع ده.<br><br>&nbsp;</p>'),(107,'Aluminum coals ','Al-Hram offers a variety of aluminum coals of the highest quality and durability ','Al-Hram offers a variety of aluminum coals of the highest quality and durability to provide the highest level of security and they go well with your aluminum doors at home, office or summer camp.',40,'2023-11-01 10:52:30','2023-11-01 10:52:30','الكوالين الألومنيوم ','الأهرام بتوفر مجموعة متنوعة من الكوالين الألومنيوم بأعلى جودة ومتانة','الأهرام بتوفر مجموعة متنوعة من الكوالين الألومنيوم بأعلى جودة ومتانة عشان توفر أعلى درجات الأمان وتتماشى مع أبوابك الألومنيوم في البيت أو المكتب أو المصيف.'),(108,'backhoe loader','To learn more about this exceptional backhoe loader and take advantage of its benefits,','<p>\r\nJoin us in our commitment to Vision 2030 and experience the power and efficiency of Digmax II 4X4 today!\r\nIf you\'d like more information about how we can assist you, please don\'t hesitate to contact us.</p>',110,'2023-11-01 11:37:08','2023-11-01 11:37:08','اللودر ذو المحراث الخلفي','لمعرفة المزيد عن هذا اللودر ذو المحراث الخلفي الاستثنائي والاستفادة من فوائده،','<p>تعرف على المزيد حول خدمات ما بعد البيع وقطع الغيار والعروض الأخرى انضم إلينا في التزامنا برؤية 2030 واستمتع بتجربة قوة وكفاءة Digmax II 4X4 اليوم!.</p>'),(109,'Tower Lights','lluminate Your Space with Premium Tower Lights','<p>Discover the extensive range of Yanmar and Hominsa tower lights brought to you by Abdullah Hashim Co.</p>',111,'2023-11-01 11:45:01','2023-11-01 11:45:01','أضواء البرج','قم بإضاءة مساحتك بأضواء البرج المميزة!','<p>اكتشف المجموعة الواسعة من مصابيح برج Yanmar وHominsa التي تقدمها لك شركة عبد الله هاشم المحدودة.</p>'),(110,'ABUS Cranes','Our Client here is the first dairy company in the UAE, All the products are made with love','<p>Founded in 1981, by the Father of the United Arab Emirates, the late Sheikh Zayed Bin Sultan Al Nahyan, Al Ain Farms was the first dairy company established in the United Arab Emirates. After 40 illustrious years, today Al Ain Farms is the largest integrated dairy company in the country, running four farms under the brand - the dairy business, the fresh juice business, the camel milk production, and the poultry section, producing fresh chicken and eggs.</p><p>The below-mentioned crane was installed by us in our client’s state of the Art facility in Al Ain.&nbsp;</p>',114,'2023-11-01 12:20:03','2023-11-01 12:20:03','رافعات ABUS','عميلنا هنا هو أول شركة ألبان في دولة الإمارات العربية المتحدة، جميع المنتجات مصنوعة بحب','<p>تأسست مزارع العين عام 1981 على يد والد دولة الإمارات العربية المتحدة، المغفور له الشيخ زايد بن سلطان آل نهيان، وكانت مزارع العين أول شركة ألبان يتم تأسيسها في دولة الإمارات العربية المتحدة. بعد 40 عامًا من النجاح، أصبحت مزارع العين اليوم أكبر شركة ألبان متكاملة في الدولة، حيث تدير أربع مزارع تحت العلامة التجارية - أعمال الألبان، وأعمال العصير الطازج، وإنتاج حليب الإبل، وقسم الدواجن لإنتاج الدجاج والبيض الطازج. .</p><p>لقد قمنا بتركيب الرافعة المذكورة أدناه في منشأة عملائنا المتطورة في العين.</p>'),(111,'Low-Grade Portal Gantry Crane','Commissioning & handover completed handsomely for a Low Grade (LG) CIL Portal Gantry Crane for One of Worlds Biggest Gold Mines in Saudi Arabia.','<p>4 years ago our client approached us looking for the best quality cranes for the most prestigious, one-of-a-kind upcoming project. Now years after looking back, ACE crane systems have been able to uphold the promises and deliver the highest quality workmanship and services.</p>',114,'2023-11-01 12:26:22','2023-11-01 12:26:22','رافعة جسرية ذات بوابة منخفضة الجودة','تم الانتهاء من التشغيل والتسليم بشكل رائع للرافعة الجسرية ذات الجودة المنخفضة  لواحد من أكبر مناجم الذهب في العالم في المملكة العربية السعودية.','<p>منذ 4 سنوات، اتصل بنا عميلنا بحثًا عن أفضل الرافعات عالية الجودة للمشروع القادم المرموق والفريد من نوعه. والآن بعد سنوات من النظر إلى الوراء، تمكنت أنظمة رافعات&nbsp;ACE من الوفاء بالوعود وتقديم أعلى مستويات الجودة في التصنيع والخدمات.</p>'),(112,'Black-matt','Black-matt hangers on wooden elements are an example of a perfect contrast combination.','<p>Black-matt hangers on wooden elements are an example of a perfect contrast combination.</p>',115,'2023-11-01 13:03:23','2023-11-01 13:03:23','الشماعات ذات اللون الأسود','تعتبر الشماعات ذات اللون الأسود غير اللامع على العناصر الخشبية مثالاً على مزيج التباين المثالي.','<p>تعتبر الشماعات ذات اللون الأسود غير اللامع على العناصر الخشبية مثالاً على مزيج التباين المثالي.</p>'),(113,'Akada Zamak','Akada Zamak Door Handle','<p>Akada Zamak Door Handle</p>',115,'2023-11-01 13:05:34','2023-11-01 13:05:34','أكادا زاماك','مقبض باب أكادا زاماك','<p>مقبض باب أكادا زاماك&nbsp;</p>'),(114,'umbrellas','King Abdulaziz Airport umbrellas','<p>King Abdulaziz Airport umbrellas</p>',137,'2023-11-01 13:32:32','2023-11-01 13:32:32','مظلات','مظلات مطار الملك عبد العزيز','<p>مظلات مطار الملك عبد العزيز</p>'),(115,'Shades','Car Parking Shades','<p>Car Parking Shades</p>',137,'2023-11-01 13:33:58','2023-11-01 13:33:58','مظلات','مظلات  مواقف سيارات','<p>مظلات &nbsp;مواقف سيارات</p>'),(116,'Sails','Shades Sails, structural tension, decoration','<p>Shades Sails, structural tension, decoration&nbsp;</p>',137,'2023-11-01 13:35:27','2023-11-01 13:35:27','الأشرعة','مظلات الأشرعة، شد انشائى، الديكور','<p>مظلات الأشرعة، شد انشائى، الديكور</p>'),(117,'Royal Commission Bridge','Royal Commission Bridge Project.','<p>The al-Batin Scaffolding team designed and constructed the suspended<br>and cantilevered access for JC barrier removal and installation purposes.</p>',156,'2023-11-02 08:01:38','2023-11-02 08:01:38','جسر الهيئة الملكية','مشروع جسر الهيئة الملكية','<p>قام فريق الباطن للسقالات بتصميم وبناء المدخل المعلق والكابولي لأغراض .JC إزالة وتركيب حواجز</p>'),(118,'well-maintained equipment','new and very well-maintained equipment','<p>With brand new and very well-maintained equipment<br>We make sure our heavy machines provide complete productivity and performance<br>for your next project.</p>',157,'2023-11-02 08:06:50','2023-11-02 08:06:50','المعدات الجديدة','المعدات الجديدة التي تمت صيانتها جيدًا','<p>بفضل المعدات الجديدة التي تمت صيانتها جيدًا،نتأكد من أن آلاتنا الثقيلة توفر إنتاجية وأداء كاملين لمشروعك القادم.</p>'),(119,'heavy equipment','Al batin heavy equipment.','<p>Our machine for productivity and performance. Al batin heavy equipment.<br>&nbsp;</p>',157,'2023-11-02 08:08:56','2023-11-02 08:08:56','المعدات الثقيلة','لبطين للمعدات الثقيلة','<p>آلتنا للإنتاجية والأداء.&nbsp;<br>البطين للمعدات الثقيلة.</p>'),(120,'Stainless doors','Stainless Steel doors','<p>Stainless Steel doors</p>',158,'2023-11-02 09:30:42','2023-11-02 09:30:42','أبواب ستانلس','أبواب ستانلس ستيل','<p>أبواب ستانلس ستيل</p>'),(121,'Metal Door','Non-Fire Rated Hollow Metal Door','<p>Successfully Installed @ Site (Housing Compound Project)<br>Non-Fire Rated Hollow Metal Door&nbsp;<br>Stamped Decorative 3-Panel Design<br>Metal Frame Jamb - Double Rabbet (G.I 1.5 mm mat\'l thickness)<br>2 Skin Metal Leaf - Interlocking Assembly (G.I 1.5 mm mat\'l thickness) Polyurethane Injection Foam</p>',159,'2023-11-02 09:34:26','2023-11-02 09:34:26','باب معدني','باب معدني مجوف غير مقاوم للحريق','<p>تم التثبيت بنجاح في الموقع (مشروع مجمع سكني)<br>باب معدني مجوف غير مقاوم للحريق<br>تصميم زخرفي مختوم من 3 لوحات<br>دعامة إطار معدني - أرنب مزدوج (سمك المادة 1.5 مم)<br>2 لوح معدني من الجلد - مجموعة متشابكة (سمك المادة 1.5 مم) رغوة حقن البولي يوريثان</p>'),(122,'URJ AL ARAB STADIUM','The hall covered in the Burj Al Arab Stadium is a new international hall, The number of stands consists of 4,500 seats for spectators.','<p>URJ AL ARAB STADIUM&nbsp;<br>The hall covered in the Burj Al Arab Stadium is a new international hall, The number of stands consists of 4,500 seats for spectators, we used 7,000 m2 of Space Frame steel system, covered with sandwich panels.</p>',189,'2023-11-06 09:27:02','2023-11-06 09:27:02','ملعب أور العرب','صالة المغطاة في استاد برج العرب هي صالة دولية جديدة، عدد المدرجات يتكون من 4500 مقعد للمشاهدين','<p>ملعب أور العرب<br>الصالة المغطاة في استاد برج العرب هي صالة دولية جديدة، عدد المدرجات يتكون من 4500 مقعد للمشاهدين، استخدمنا 7000 م2 من نظام Space Frame الفولاذي، مغطى بألواح شطيرة.</p>'),(123,'Clevis Pipe Hanger','Standard Clevis Pipe Hanger from Al Nour for Metalworking','<p>Standard Clevis Pipe Hanger from Al Nour for Metalworking.<br>Carbon steel made with and electroplated finish.<br>UL &amp; FM Approved.</p>',192,'2023-11-06 10:13:47','2023-11-06 10:13:47','هنجر كليفز','هنجر كليفس القياسية من النور لتشغيل المعادن','<p>هنجر كليفس القياسية من النور لتشغيل المعادن.<br>فولاذ كربوني مصنوع بلمسة نهائية مطلية بالكهرباء.<br>معتمد من UL وFM.</p>'),(124,'Elbow smell','Innovative design increase exchange rate','<p>Elbow smell silent from pain<br>Innovative design increase exchange rate<br>Preventing the recurrence of stinks&nbsp;<br>10 years warranty.<br>&nbsp;</p>',195,'2023-11-06 10:55:42','2023-11-06 10:55:42','كوع ريحه','تصميم مبتكر يزيد معدل الصرف','<p><br>كوع ريحه صامت من المُنى<br>تصميم مبتكر يزيد معدل الصرف<br>منع ارتداد &nbsp;الروائح الكريهة<br>ضمان 10 سنوات</p>'),(125,'COB Street Light','Classification : IP 65\r\nApplication: High ways, metros, primary streets, resident\r\n areas, parking lots, gardens and so on.','<p>Classification : IP 65<br>Application: High ways, metros, primary streets, resident<br>areas, parking lots, gardens and so on.<br>Installation: Pole mounted<br>Material: The body is made of high pressure die-cast<br>aluminum alloy housing with less weight. High<br>efficiency coatings, paint and metal parts<br>successfully pass 600 hours salt spray test.</p><p>Light Controller: High transparent optical lens and<br>Tempered glass<br>PCB: Metal Clad Aluminum PCB.<br>Color Rendering Index (CRI):&gt;80.<br>Correlated Color Temperature (CCT): Day Light- 6500K.<br>Warm Light- 3000K.<br>Emergency: No.</p>',197,'2023-11-06 11:46:22','2023-11-06 11:46:22','COB ضوء الشارع','درجة الحماية : 65 IP\r\nأماكن الإستعمال: الطرق السريعة، المترو، الشوارع الرئيسية، المناطق\r\n السكنية، مواقف السيارات، الحدائق، وغيرھا.','<p>درجة الحماية : 65 IP<br>أماكن الإستعمال: الطرق السريعة، المترو، الشوارع الرئيسية، المناطق<br>السكنية، مواقف السيارات، الحدائق، وغيرھا.<br>. يعلق على عمود<br>طريقة التركيب:<br>الھيكل: الجسم مصنوع من غطاء الألومنيوم النقي عالية الضغط ذو وزن أقل.<br>الطلاء ذو كفاءة عالية اجتاز بنجاح 600 ساعة اختبار رش الملح.</p><p>الأغطية والعواكس: العدسة البصرية ذو شفافية عالية، والغطاء الزجاجي صلب.<br>الدائرة الكھربائية: مصنوع من المعدن المغطاة بالألمنيوم.<br>مؤشر تجسيد اللون: ?80<br>درجة حرارة اللون: اللون الأبيض – 6500 كالفن.<br>اللون الأصفر – 3000 كالفن.<br>البطارية: لا توجد.</p>'),(126,'SAAFA CORNICHE STREET LIGHTING','SAAFA CORNICHE STREET LIGHTING\r\nPublic Works Authority (Ashghal)','<p>SAAFA CORNICHE STREET LIGHTING<br>Public Works Authority (Ashghal)</p><p>SCOPE OF WORK<br>Supply of LED street light modules and linear profiles for Saafa (frond) streetlight.<br>&nbsp;</p>',205,'2023-11-06 12:38:15','2023-11-06 12:38:15','إنارة شارع الكورنيش الصفا','إنارة شارع الكورنيش الصفا\r\nهيئة الأشغال العامة (أشغال)','<p>إنارة شارع الكورنيش الصفا<br>هيئة الأشغال العامة (أشغال)</p><p>مجال العمل:<br>توريد وحدات إنارة الشوارع LED والمقاطع الخطية لإنارة شارع الصفا (السعفة).</p>'),(127,'French epoxy adhesive','Universal French epoxy adhesive for different surfaces.','<p><strong>4 minute epoxy adhesive. It consists of two compounds that are as strong as iron - it kills salt within 4 minutes. It is used in shiny bathrooms. It uses what is high in adhesive - repair - filling voids - preventing leakage. It can be drilled, sanded and filed after hardening.</strong></p>',214,'2023-11-06 13:37:21','2023-11-06 13:37:21','اللاصق الايبوكسى الفرنسى','اللاصق الايبوكسى الفرنسى العالمى للاسطح المختلفة.','<p>لاصق إيبوكسى 4 دقائق ,<strong>يتكون من مركبين قوى كالحديد -يتصلب خلال 4 دقائق</strong>.يستخدم فى الداخل والخارج.يستخدم بكفاءة عالية فى اللصق-الإصلاح-ملء الفراغات-منع التسرب. يمكن ثقبه وصنفرته وبرده بعد التصلب.</p>'),(128,'home elevator technique','the most home elevator technique in New Giza compound','<p>the most home elevator technique in New Giza compound, which is completely designed and manufactured by Ateco, lt\'s such Italian\'s home lift.</p>',218,'2023-11-06 13:55:12','2023-11-06 13:55:12','المصاعد المنزلية','اكثر تقنيات المصاعد المنزلية في كمبوند نيو جيزة','<p>&nbsp;أكثر تقنيات المصاعد المنزلية في كمبوند نيو جيزة&nbsp;<br>والتي تم تصميمها وتصنيعها بالكامل من قبل شركة الإيطالية المنزلية</p>'),(129,'high-quality Cast Resin Transformers','These high-quality Cast Resin Transformers are the ideal choice for all needs, with advantages like:\r\nTotal safety for the customer, guaranteed by the total absence of combustible products','<p>These high-quality Cast Resin Transformers are the ideal choice for all needs, with advantages like:<br>Total safety for the customer, guaranteed by the total absence of combustible products<br>Maximum environmental protection, thanks to the absence of polluting and flammable insulating liquids<br>Energy saving, with the exclusive “reduced loss” range<br>Maximum flexibility straight from the beginning of the installation.</p>',219,'2023-11-07 08:58:08','2023-11-07 08:58:08','محولات الراتنج المصبوب عالية الجودة','تعتبر محولات الراتنج المصبوب عالية الجودة هذه الخيار الأمثل لجميع الاحتياجات، مع مزايا مثل:\r\nالسلامة الكاملة للعميل، والتي يضمنها الغياب التام للمنتجات القابلة للاحتراق','<p>تعتبر محولات الراتنج المصبوب عالية الجودة هذه الخيار الأمثل لجميع الاحتياجات، مع مزايا مثل:<br>السلامة الكاملة للعميل، والتي يضمنها الغياب التام للمواد القابلة للاحتراق<br>أقصى حماية للبيئة، وذلك بفضل عدم وجود سوائل عازلة ملوثة وقابلة للاشتعال<br>توفير الطاقة، مع نطاق \"الفقد المنخفض\" الحصري<br>أقصى قدر من المرونة مباشرة من بداية التثبيت</p>'),(130,'FORCE shoes Half','FORCE shoes\r\n Half \r\nTaking care of safety in its design:\r\nEquipped with slip resistant slippers','<p>FORCE shoes<br>Half<br>Taking care of safety in its design:<br>Equipped with slip resistant slippers<br>Equipped #steel_foot_protective<br>#Steel_slice is equipped to prevent penetration<br>#Anti oil and water<br>All sizes are available from 40 to 46</p>',220,'2023-11-07 09:21:51','2023-11-07 09:21:51','حذاء FORCE  هـــــــاف','حذاء FORCE\r\n هـــــــاف \r\nمع الاعتناء بالامان فى تصميمه\r\nمجهزة بنعال مقاومة للانزلاق','<p>حذاء &nbsp;FORCE<br>هـــــــاف<br>مع الاعتناء بالامان فى تصميمه<br>مجهزة بنعال مقاومة للانزلاق&nbsp;<br>مجهزة #مقدمه_صلب تحمي القدمين&nbsp;<br>مجهزة #شريحة_صلب لمنع الاختراق&nbsp;<br>مضاد للزيوت و المياه<br>يوجد جميع المقاسات من 40 الى 46</p>'),(131,'color coated steel sheet','metal sheet such as color coated steel sheet \r\nand galvanized sheet, steel structure and housing construction.','<p>CUS-STEEL began to produce color coated steel sheet from 2002, &nbsp;In 2004, color coated steel coil products were exported to European and Russian markets for the first time.</p>',224,'2023-11-07 09:55:25','2023-11-07 09:55:25','صفائح فولاذية مطلية بالألوان','لصفائح المعدنية مثل صفائح الفولاذ المطلية بالألوان والصفائح المجلفنة والهياكل الفولاذية وبناء المساكن','<p>بدأت CUS-STEEL في إنتاج صفائح الفولاذ المطلية بالألوان منذ عام 2002، وفي عام 2004، تم تصدير منتجات لفائف الفولاذ المطلية بالألوان إلى الأسواق الأوروبية والروسية لأول مرة</p>'),(132,'High-light reflectance ceilings','High-light reflectance ceilings improve interior design while reducing \r\nsuperfluous illumination.White ceilings may reflect up to 75% of available light.','<p>High-light reflectance ceilings improve interior design while reducing&nbsp;<br>superfluous illumination. White ceilings may reflect up to 75% of available light,&nbsp;<br>saving energy and money.&nbsp;<br>They provide fire and water resistance, impact resistance,&nbsp;<br>humidity resistance, and sag resistance. Ceilings that are well-designed lower&nbsp;<br>maintenance expenses, lighting fixtures, and energy efficiency.</p>',236,'2023-11-07 11:42:36','2023-11-07 11:42:36','أسقف عاكسة للضوء عالية','تعمل الأسقف العاكسة للضوء العالية على تحسين التصميم الداخلي مع تقليل الإضاءة الزائدة. قد تعكس الأسقف البيضاء ما يصل إلى 75% من الضوء المتاح','<p>تعمل الأسقف العاكسة للضوء العالية على تحسين التصميم الداخلي مع تقليل الإضاءة الزائدة. قد تعكس الأسقف البيضاء ما يصل إلى 75% من الضوء المتاح، مما يوفر الطاقة والمال.<br>أنها توفر مقاومة للحريق والماء، ومقاومة التأثير، ومقاومة الرطوبة، ومقاومة الترهل. الأسقف المصممة جيدًا تقلل من تكاليف الصيانة وتركيبات الإضاءة وكفاءة الطاقة.</p>'),(133,'side scan sonar','Photographing and scanning the bottom with high precision is done using \r\nthe marine scanning devices of side scan sonar category from the International \r\nHigh Definition','<p>Photographing and scanning the bottom with high precision is done using&nbsp;<br>the marine scanning devices of side scan sonar category from the International&nbsp;<br>High Definition<br>SOUTH Surveying &amp; Mapping&nbsp;<br>Marine scanning system HYSWORD SS500 is one of the modern systems that entered&nbsp;<br>the field of marine scanning recently in 2023 for Thouth Company, it supports&nbsp;<br>integrated monitoring technology via Dual Gnss Antenna to receive satellite signals,&nbsp;<br>and it can perform scanning and imaging at a depth of 150 meters.<br>SS500 supports 4K scanning technology via 500 khz sound wave unit with 0.75 cm accuracy,&nbsp;<br>in addition to exporting files in GDSS XTF format,&nbsp;<br>it can also be installed in USV units or pulled on TOWFISH marine scanning launch.</p>',237,'2023-11-07 12:30:56','2023-11-07 12:30:56','سونار المسح الجانبي','يتم تصوير ومسح القوس بدقة عالية بإستخدام اجهزة المسح البحري فئة المسح الجانبي بسونار ثاوث العالمية عالي الدقة\r\nالمسح الجنوبي ورسم الخرائط','<p>يتم تصوير ومسح القوس بدقة عالية بإستخدام اجهزة المسح البحري فئة المسح الجانبي بالسونار من ثاوث العالمية عالي الدقة<br>المسح الجنوبي ورسم الخرائط<br>نظام المسح البحري HYSWORD SS500 احد الانظمة الذكية التي دخلت مجال المسح الحديث في الآونة الأخيرة في عام 2023 لشركة ثاوث ، يدعم تقنية الرصد المدمجة عبر Dual Gnss Antenna<br>لاستقبال استشارات الاقمار الاصطناعية، كما يمكنه القيام بالمسح الضوئي والتصوير 150 مترا .<br>يدعم SS500 تقنية المسح 4K عبر وحدة الإرسال بالموجات فوق الصوتية 500 كيلو هرتز مع إمكانية الوصول إلى 0.75 سم بالإضافة إلى تصدير الملفات بصيغة GDSS XTF،<br>&nbsp;كما يمكن تثبيته في وحدات USV او جره علي لانش المسح العملي TOWFISH.</p>'),(135,'Vertical space frame structure','the 1st Vertical space frame structure in the world for 57357 Hospital','<p>We are proud to build the 1st Vertical space frame structure in the world for 57357 Hospital with a single layer dome (28m space frame).</p>',189,'2023-11-09 09:01:08','2023-11-09 09:01:08','هيكل إطار الفضاء العمودي','بناء أول هيكل إطاري فضائي عمودي في العالم لمستشفى 57357','<p>نحن فخورون ببناء أول هيكل إطاري فضائي عمودي في العالم لمستشفى 57357 بقبة ذات طبقة واحدة (إطار فضائي 28 مترًا.</p>'),(136,'wooden bike track','We are proud to have built the first and largest wooden bike track in the Middle','<p>Cairo International Stadium<br>We are proud to have built the first and largest wooden bike track in the Middle East and covered the entire area of 11000m2 with 3D steel structures.</p>',189,'2023-11-09 09:30:03','2023-11-09 09:30:03','مسار خشبي للدراجات','حن فخورون بأننا قمنا ببناء أول وأكبر مسار خشبي للدراجات في الشرق الأوسط','<p>ستاد القاهرة الدولي<br>نحن فخورون بأننا قمنا ببناء أول وأكبر مسار خشبي للدراجات في الشرق الأوسط وغطى كامل مساحة 11000 متر مربع بهياكل فولاذية ثلاثية الأبعاد.</p>'),(137,'SMD Recessed Mount UP Light with Aluminum Reflector','SMD Recessed Mount UP Light with\r\nAluminum Reflector: