signals, used for monitoring or controlling electrical power systems and their associated processes.These cables are used in diverse applications within industrial process manufacturing plants for control, communication, data (analog/digital), and voice transmission signals in industries like Oil &amp; Gas, Petro-Chemicals, Off-Shore Oil Rigs, and Cement Factories.</p>',219,'2023-11-12 10:59:49','2023-11-12 10:59:49','كابلات الأجهزة','كابلات الأجهزة عبارة عن كابلات موصلة متعددة تنقل الإشارات الكهربائية','<p>كابلات الأجهزة عبارة عن كابلات موصلة متعددة تنقل الإشارات الكهربائية، وتستخدم لمراقبة أو التحكم في أنظمة الطاقة الكهربائية والعمليات المرتبطة بها. وتستخدم هذه الكابلات في تطبيقات متنوعة داخل مصانع تصنيع العمليات الصناعية للتحكم، والاتصالات، والبيانات (التناظرية / الرقمية)، و إشارات النقل الصوتي في صناعات مثل النفط والغاز والبتروكيماويات ومنصات النفط البحرية ومصانع الأسمنت.</p>'),(143,'Bahra Enclosures','Bahra Enclosures are designed to accommodate various types of switchgear and controlgear assemblies','<p>Bahra Enclosures are designed to accommodate various types of switchgear and controlgear assemblies suitable for all types of electrical installation, especially for commercials and industrial sectors. They are designed for outdoor applications up to IP-65</p>',219,'2023-11-12 11:48:23','2023-11-12 11:48:23','حاويات بحرة','تم تصميم حاويات بحرة لاستيعاب أنواع مختلفة من مجموعات المفاتيح الكهربائية وأجهزة التحكم','<p>تم تصميم حاويات بحرة لاستيعاب أنواع مختلفة من مجموعات المفاتيح الكهربائية وأجهزة التحكم المناسبة لجميع أنواع التركيبات الكهربائية، وخاصة للقطاعات التجارية والصناعية. وهي مصممة للتطبيقات الخارجية حتى IP-65</p>'),(144,'3max The Mask N95','An N95 mask or N95 respirator is a particulate filtering face respirator','<p>An N95 mask or N95 respirator is a particulate filtering face respirator that meets the US National Institute for Occupational Safety and Health (NIOSH) N95 air filtration rating, meaning it filters out at least 95% of airborne particles. This standard does not require that the mask be oil-resistant; While another standard, P95, adds this requirement. The N95 type is the most common external particle-filtering respirator. It is an example of a mechanical filter respirator, which provides protection against particles but not against gases or vapors.</p>',220,'2023-11-12 12:02:43','2023-11-12 12:02:43','كمامة 3max N95','قناع N95 أو جهاز التنفس الصناعي N95 هو جهاز تنفس من الوجه مرشح الجسيمات','<p>قناع N95 أو جهاز التنفس الصناعي N95 هو جهاز تنفس من الوجه مرشح الجسيمات ويفي بالمعهد الوطني الأمريكي للسلامة والصحة المهنية (NIOSH) N95 لتصنيف ترشيح الهواء، مما يعني أنه يقوم بترشيح 95% على الأقل من الجسيمات المحمولة جواً. ولا يتطلب هذا المعيار أن تكون الكمامة مقاومة للزيت؛ بينما يضيف معيار آخر، وهو P95، هذا المطلب. يعد النوع N95 هو أكثر كمامة من الكمامة الخارجية التي تعمل بتنقية الجسيمات شيوعًا. وهو مثال على جهاز التنفس الصناعي الخاص بالفلتر الميكانيكي، والذي يوفر الحماية ضد الجسيمات وليس ضد الغازات أو الأبخرة.</p>'),(145,'Helmet and face shield','A face shield, an item of personal protective equipment (PPE), aims to protect the wearer\'s entire face (or part of it) from hazards','<p>A face shield, an item of personal protective equipment (PPE), aims to protect the wearer\'s entire face (or part of it) from hazards such as flying objects and road debris, chemical splashes (in laboratories or in industry), or potentially infectious materials (in medical and laboratory environments). Depending on the type used, a face shield may protect its wearer from a physical hazard, chemical splashes, or biological hazards.</p>',220,'2023-11-12 12:12:55','2023-11-12 12:12:55','خوذة وواقي وجه','يهدف درع الوجه، أحد عناصر معدات الحماية الشخصية (PPE)، إلى حماية وجه مرتديه بالكامل (أو جزء منه) من المخاطر','<p>يهدف درع الوجه، أحد عناصر معدات الحماية الشخصية (PPE)، إلى حماية وجه مرتديه بالكامل (أو جزء منه) من المخاطر مثل الأجسام الطائرة وحطام الطريق، والرذاذ الكيميائي (في المختبرات أو في الصناعة)، أو العدوى المحتملة المواد (في البيئات الطبية والمخبرية). اعتمادًا على النوع المستخدم، قد يحمي درع الوجه مرتديه من المخاطر الجسدية أو البقع الكيميائية أو المخاطر البيولوجية.</p>'),(146,'USG ME\'s soft fiber','With USG ME\'s soft fiber - stone wool ceilings, you\'ll get the greatest in acoustic \r\nperformance!','<p>With USG ME\'s soft fiber - stone wool ceilings, you\'ll get the greatest in acoustic&nbsp;<br>performance!&nbsp;<br>These ceilings not only provide great sound absorption and reflection,&nbsp;<br>but they also perform well in terms of fire resistance, light reflectance,&nbsp;<br>and longevity.&nbsp;<br>Furthermore, with a focus on sustainability, our stone wool ceilings offer&nbsp;<br>the best mix of performance and aesthetics.&nbsp;<br>We have the finest sound-performing ceilings in the region,&nbsp;<br>with choices exceeding 1.0 NRC and 39 dB CAC.&nbsp;</p>',236,'2023-11-13 11:54:08','2023-11-13 11:54:08','أسقف USG ME','مع أسقف USG ME المصنوعة من الألياف الناعمة والصوف الحجري، سوف تحصل على أفضل أداء صوتي','<p>مع أسقف USG ME المصنوعة من الألياف الناعمة والصوف الحجري، سوف تحصل على أفضل أداء صوتي! لا توفر هذه الأسقف امتصاصًا وانعكاسًا رائعًا للصوت فحسب،<br>بل إنها تؤدي أيضًا أداءً جيدًا من حيث مقاومة الحريق وانعكاس الضوء وطول العمر.<br>علاوة على ذلك، ومع التركيز على الاستدامة، توفر أسقف الصوف الحجري لدينا أفضل مزيج من الأداء والجماليات.<br>لدينا أفضل الأسقف أداءً للصوت في المنطقة، مع خيارات تتجاوز 1.0 NRC و39 ديسيبل CAC.</p>'),(147,'Soundproofing walls','Soundproofing walls, windows, and doors is essential for improving acoustic','<p>Soundproofing walls, windows, and doors is essential for improving acoustic&nbsp;<br>performance in homes and offices.&nbsp;<br>Inadequate soundproofing can cause transmission and absorption issues.&nbsp;<br>To achieve optimal performance, consider a sound control strategy from the&nbsp;<br>beginning of a construction project.&nbsp;<br>Eliminate undesired noises, use absorbing materials, and soundproof areas,&nbsp;<br>and consider noise-masking or noise-absorbing designs.&nbsp;<br>Windows can be difficult to soundproof due to their swinging open or removal.&nbsp;<br>Use the Sound Reduction Index (Rw) to measure the level of sound insulation&nbsp;<br>provided by walls, floors, windows, and doors.&nbsp;<br>&nbsp;</p>',236,'2023-11-13 12:00:02','2023-11-13 12:00:02','الجدران العازلة للصوت','تعد الجدران والنوافذ والأبواب العازلة للصوت ضرورية لتحسين الأداء الصوتي في المنازل والمكاتب.','<p>تعد الجدران والنوافذ والأبواب العازلة للصوت ضرورية لتحسين الأداء الصوتي في المنازل والمكاتب.<br>قد يؤدي العزل الصوتي غير الكافي إلى حدوث مشكلات في النقل والامتصاص. لتحقيق الأداء الأمثل، ضع في الاعتبار استراتيجية التحكم السليمة منذ بداية مشروع البناء.<br>القضاء على الضوضاء غير المرغوب فيها، واستخدام المواد الماصة، والمناطق العازلة للصوت، والنظر في تصميمات حجب الضوضاء أو امتصاص الضوضاء.<br>قد يكون من الصعب عزل النوافذ بسبب تأرجحها عند فتحها أو إزالتها. استخدم مؤشر خفض الصوت (Rw) لقياس مستوى عزل الصوت الذي توفره الجدران والأرضيات والنوافذ والأبواب.</p>'),(148,'SLAM100','With #SLAM100, you can perform a fast scan in 20-30 minutes \r\ncapable of capturing more than 160 million RGB colored dots.','<p>With #SLAM100, you can perform a fast scan in 20-30 minutes&nbsp;<br>capable of capturing more than 160 million RGB colored dots.&nbsp;<br>It enables you to extract 3D sculpted scopes and build digital BIM models&nbsp;<br>by integrating with DIGITAL TWIN.<br>slam100 can connect fixed points in multiple ways and it can work&nbsp;<br>in the dark without affecting the point cloud,&nbsp;<br>especially working on more than one different operating platform.</p>',237,'2023-11-13 12:16:11','2023-11-13 12:16:11','SLAM100','بإستخدام #SLAM100 تستطيع القيام بعملية مسح سريعة في مدة تتراوح من 20 الي 30 دقيقة قادرة علي إلتقاط اكثر من 170 مليون نقطة ملونة RGB','<p>&nbsp;</p><p>بإستخدام #SLAM100 تستطيع القيام بعملية مسح سريعة في مدة تتراوح من 20 الي 30 دقيقة قادرة علي إلتقاط اكثر من 170 مليون نقطة ملونة RGB&nbsp;<br>تمكنك من استخراج مساقط مجسمة 3D و بناء النماذج الرقمية BIM عن طريق التكامل مع التوأمة الرقمية DIGITAL TWIN.<br>يستطيع slam100 الربط علي نقاط الثوابت بطرق متعددة كمان انه يستطيع العمل في الظلام بدون التأثير علي السحابة النقطية ، و لا سيما العمل علي اكثر من منصة تشغيل مختلفة.</p>'),(149,'Carbon Steel Coil','Carbon Steel Coil\r\nWidth	customized\r\nThickness	customized\r\nSurface	Black, painted, oiled, or as your requirement\r\nMaterial	Q195~Q345, SPCC, SPCD, SPCE, ST12-15, DC01-06, etc.(#50, A36M,SS400)\r\nTechnique	Cold Rolled or Hot Rolled','<p>Carbon Steel Coil<br>Width&nbsp;&nbsp;&nbsp;&nbsp;customized<br>Thickness&nbsp;&nbsp;&nbsp;&nbsp;customized<br>Surface&nbsp;&nbsp;&nbsp;&nbsp;Black, painted, oiled, or as your requirement<br>Material&nbsp;&nbsp;&nbsp;&nbsp;Q195~Q345, SPCC, SPCD, SPCE, ST12-15, DC01-06, etc.(#50, A36M,SS400)<br>Technique&nbsp;&nbsp;&nbsp;&nbsp;Cold Rolled or Hot Rolled<br>Support Processing Service&nbsp;&nbsp;&nbsp;&nbsp;Bending, Welding, Decoiling, Punching, Cutting, Moulding or Customized<br>Standard&nbsp;&nbsp;&nbsp;&nbsp;JIS, AiSi, ASTM, GB, DIN, EN<br>Support Certification&nbsp;&nbsp;&nbsp;&nbsp;ISO, IBR, BV, SGS, RoHS<br>Applicat iIndustry, Manufacturing, Architecture, Decoration, Kitchen etc.</p>',224,'2023-11-15 08:59:04','2023-11-15 08:59:04','لفائف الصلب الكربوني','لفائف الصلب الكربوني\r\nالعرض حسب الطلب\r\nسمك حسب الطلب\r\nالسطح أسود، مطلي، مزيت، أو حسب متطلباتك\r\nالمواد Q195 ~ Q345، SPCC، SPCD، SPCE، ST12-15، DC01-06، وما إلى ذلك (#50، A36M،SS400)\r\nتقنية المدرفلة على البارد أو المدرفلة على الساخن','<p>لفائف الصلب الكربوني<br>العرض حسب الطلب<br>سمك حسب الطلب<br>السطح أسود، مطلي، مزيت، أو حسب متطلباتك<br>المواد Q195 ~ Q345، SPCC، SPCD، SPCE، ST12-15، DC01-06، وما إلى ذلك (#50، A36M،SS400)<br>تقنية المدرفلة على البارد أو المدرفلة على الساخن<br>دعم خدمة المعالجة الانحناء أو اللحام أو فك اللفائف أو اللكم أو القطع أو التشكيل أو حسب الطلب<br>معيار JIS، AiSi، ASTM، GB، DIN، EN<br>دعم شهادة ISO، IBR، BV، SGS، RoHS<br>صناعة التطبيقات والتصنيع والهندسة المعمارية والديكور والمطبخ وما إلى ذلك.&