p>'),(193,'Boom Seal with wipe','FEATURES	\r\nClear PVC Seal and Wipe between on the boom of the door as a wipe. Standard length 2200mm. Suitable to use on 10 & 12mm thick glass.','<p>Boom Seal with wipe<br>E10-05WSF</p><p>FEATURES&nbsp;&nbsp;&nbsp;&nbsp;<br>Clear PVC Seal and Wipe between on the boom of the door as a wipe. Standard length 2200mm. Suitable to use on 10 &amp; 12mm thick glass.</p>',358,'2023-11-21 09:54:00','2023-11-21 09:54:00','بوم ختم مع مسح','سمات\r\nقم بمسح ختم PVC وامسحه على ذراع الباب كمسح. الطول القياسي 2200 مم. مناسب للاستخدام على الزجاج بسماكة 10 و12 ملم.','<p>بوم ختم مع مسح<br>E10-05WSF</p><p>سمات<br>قم بمسح ختم PVC وامسحه على ذراع الباب كمسح. الطول القياسي 2200 مم. مناسب للاستخدام على الزجاج بسماكة 10 و12 ملم.</p>'),(194,'Round Grip Glass Knob','FEATURES	\r\nBack-to-back shower door knob\r\nMaterial: Brass, Size: 30mm','<p>Round Grip Glass Knob<br>SH75DK</p><p>FEATURES&nbsp;&nbsp;&nbsp;&nbsp;<br>Back-to-back shower door knob<br>Material: Brass, Size: 30mm</p><p>FINISH&nbsp;&nbsp;&nbsp;&nbsp;<br>Matt Black<br>Polished Stainless Steel<br>Stainless steel</p>',358,'2023-11-21 09:57:23','2023-11-21 09:57:23','مقبض زجاجي بقبضة مستديرة','سمات\r\nمقبض باب الدش من الخلف إلى الخلف\r\nالخامة: نحاس، المقاس: 30 مم','<p>مقبض زجاجي بقبضة مستديرة<br>SH75DK</p><p>سمات<br>مقبض باب الدش من الخلف إلى الخلف<br>الخامة: نحاس، المقاس: 30 مم</p><p>انواع<br>مات بلاك<br>الفولاذ المقاوم للصدأ المصقول<br>الفولاذ المقاوم للصدأ</p>'),(195,'twin wheel','Tandema-mini twin wheel\r\noption of with breaks and without breaks','<p>Tandema-mini twin wheel<br>option of with breaks and without breaks</p><p>FEATURES&nbsp;&nbsp;&nbsp;&nbsp;<br>Loading capacity: 45kg/pcs<br>Material: Nylon plastic<br>Thickness to wheel surface: 10mm</p><p>FINISH&nbsp;&nbsp;&nbsp;&nbsp;<br>Black</p>',360,'2023-11-21 10:00:03','2023-11-21 10:00:03','عجلة مزدوجة','عجلة مزدوجة تانديما صغيرة\r\nخيار مع فواصل وبدون فواصل','<p>عجلة مزدوجة تانديما صغيرة<br>خيار مع فواصل وبدون فواصل</p><p>سمات<br>قدرة التحميل: 45 كجم/قطعة<br>المواد: بلاستيك نايلون<br>سمك سطح العجلة: 10 ملم</p><p>انواع<br>أسود</p>'),(196,'shelf support Pin','shelf support Pin\r\nwith 100 kgs weight capacity','<p>shelf support Pin<br>with 100 kgs weight capacity</p><p>FINISH&nbsp;&nbsp;&nbsp;&nbsp;<br>Nickel</p>',360,'2023-11-21 10:01:48','2023-11-21 10:01:48','دبوس دعم الرف','دبوس دعم الرف\r\nبسعة وزن 100 كجم','<p>دبوس دعم الرف<br>بسعة وزن 100 كجم</p><p>انواع:-<br>النيكل</p>'),(197,'Electric Forklift Trucks','Our forklifts are designed using our heavy equipment expertise to provide durable and dependable performance throughout their lifetime, providing our customers with greater value through lower costs of operation, day-after-day','<p>At Komatsu we have a long heritage of building heavy-duty, high quality equipment for our customers. Founded in 1921 in Komatsu City, Japan, Komatsu is a global leader in equipment design and manufacturing, and is the second largest manufacturer in the world with 25 plants globally. Our forklifts are designed using our heavy equipment expertise to provide durable and dependable performance throughout their lifetime, providing our customers with greater value through lower costs of operation, day-after-day.</p>',364,'2023-11-21 10:51:26','2023-11-21 10:51:26','شاحنات الرافعة الشوكية الكهربائية','تم تصميم الرافعات الشوكية لدينا باستخدام خبرتنا في المعدات الثقيلة لتوفير أداء متين ويمكن الاعتماد عليه طوال عمرها الافتراضي، مما يوفر لعملائنا قيمة أكبر من خلال انخفاض تكاليف التشغيل يومًا بعد يوم.','<p>في كوماتسو لدينا تراث طويل في بناء المعدات الثقيلة وعالية الجودة لعملائنا. تأسست كوماتسو عام 1921 في مدينة كوماتسو باليابان، وهي شركة رائدة عالميًا في تصميم وتصنيع المعدات، وهي ثاني أكبر مصنع في العالم مع 25 مصنعًا على مستوى العالم. تم تصميم الرافعات الشوكية لدينا باستخدام خبرتنا في المعدات الثقيلة لتوفير أداء متين ويمكن الاعتماد عليه طوال عمرها الافتراضي، مما يوفر لعملائنا قيمة أكبر من خلال انخفاض تكاليف التشغيل يومًا بعد يوم.</p>'),(198,'Diesel & Gasoline Forklift Trucks','Reliable power and excellent fuel efficiency.\r\nLowered operating cost while while maximizing productivity.\r\nGreat design with for low servicing costs and easy maintenance.','<p>Komatsu is one of the leading manufacturers of electric, gasoline and diesel powered forklifts in the world. The product range covers from 0.5 Ton to 25 Ton lifting capacity. Komatsu Forklifts are the market leaders in UAE and are widely accepted as the most reliable while also offering:</p><p>Reliable power and excellent fuel efficiency.<br>Lowered operating cost while while maximizing productivity.<br>Great design with for low servicing costs and easy maintenance.<br>Wide variety attachment &amp; options to meet all your work application &amp; environment needs like Roll Clamp, Side Shifter, Bale Clamp, Rotating Fork, Fork Clamp.</p>',364,'2023-11-21 10:54:14','2023-11-21 10:54:14','رافعات شوكية تعمل بالديزل والبنزين','قوة موثوقة وكفاءة ممتازة في استهلاك الوقود.\r\nخفض تكلفة التشغيل مع زيادة الإنتاجية إلى أقصى حد.\r\nتصميم رائع مع تكاليف خدمة منخفضة وسهولة الصيانة.','<p>رافعات شوكية تعمل بالديزل والبنزين</p><p>كوماتسو هي إحدى الشركات الرائدة في مجال تصنيع الرافعات الشوكية التي تعمل بالكهرباء والبنزين والديزل في العالم. تغطي مجموعة المنتجات قدرة رفع تتراوح من 0.5 طن إلى 25 طن. تعتبر الرافعات الشوكية كوماتسو هي الرائدة في السوق في دولة الإمارات العربية المتحدة ويتم قبولها على نطاق واسع باعتبارها الأكثر موثوقية بينما تقدم أيضًا:</p><p>قوة موثوقة وكفاءة ممتازة في استهلاك الوقود.<br>خفض تكلفة التشغيل مع زيادة الإنتاجية إلى أقصى حد.<br>تصميم رائع مع تكاليف خدمة منخفضة وسهولة الصيانة.<br>مجموعة واسعة من الملحقات والخيارات لتلبية جميع احتياجات تطبيقات العمل والبيئة الخاصة بك مثل Roll Clamp، وSide Shifter، وBale Clamp، وRotating Fork، وFork Clamp.</p>'),(199,'DOZERS RANGE','Built-in intelligence combined with skill and power\r\nKomatsu repeats his successful track record in bulldozers with the full line of the most technologically advanced and innovative dozers.','<p>Built-in intelligence combined with skill and power<br>Komatsu repeats his successful track record in bulldozers with the full line of the most technologically advanced and innovative dozers. With innovations like the 15% more productive Komatsu exclusive SIGMADOZER® blade or the super slant dozer design which creates the best balanced fine grading dozers with unrivaled visibility, Komatsu Dozers are best-in-class.</p>',365,'2023-11-21 10:56:21','2023-11-21 10:56:21','نطاق الجرارات','الذكاء المدمج مع المهارة والقوة\r\nتكرر كوماتسو سجلها الناجح في مجال الجرافات من خلال خط كامل من الجرافات الأكثر تقدمًا وابتكارًا من الناحية التكنولوجية.','<p>الذكاء المدمج مع المهارة والقوة<br>تكرر كوماتسو سجلها الناجح في مجال الجرافات من خلال خط كامل من الجرافات الأكثر تقدمًا وابتكارًا من الناحية التكنولوجية. بفضل الابتكارات مثل شفرة SIGMADOZER® الحصرية من كوماتسو الأكثر إنتاجية بنسبة 15% أو تصميم الجرار فائق الانحدار الذي يخلق أفضل الجرارات ذات التدرج الدقيق الأفضل توازنًا مع رؤية لا مثيل لها، فإن جرارات كوماتسو هي الأفضل في فئتها.</p>'),(200,'Graders','Exceptional fine grading performance\r\nThe specially designed Komatsu motor graders set themselves apart from the competition with their accuracy and versatility.','<p>Graders<br>Exceptional fine grading performance<br>The specially designed Komatsu motor graders set themselves apart from the competition with their accuracy and versatility. The motor graders have defined high maneuverability with a minimum turning radius from a long wheelbase. With its improved optimal machine balance, cooling efficiency, and reduced hydraulic pressure loss Komatsu motor graders deliver high production efficiency along with high production volumes.</p>',365,'2023-11-21 10:59:17','2023-11-21 10:59:17','ممهدات الطرق','أداء استثنائي للدرجات الدقيقة\r\nإن ممهدات الطرق كوماتسو المصممة خصيصًا تميز نفسها عن المنافسة بفضل دقتها وتعدد استخداماتها.','<p>ممهدات الطرق<br>أداء استثنائي للدرجات الدقيقة<br>إن ممهدات الطرق كوماتسو المصممة خصيصًا تميز نفسها عن المنافسة بفضل دقتها وتعدد استخداماتها. تتميز ماكينات التسوية بقدرة عالية على المناورة مع الحد الأدنى من نصف قطر الدوران من قاعدة العجلات الطويلة. بفضل التوازن الأمثل للماكينة، وكفاءة التبريد، وانخفاض فقدان الضغط الهيدروليكي، توفر ماكينات التسوية التي تعمل بمحرك كوماتسو كفاءة إنتاج عالية إلى جانب أحجام الإنتاج الكبيرة.</p>'),(201,'Varimat V2','12 m/min maximum welding speed (depending on material).\r\nGuide bar for ergonomic handling\r\nMaintenance free blower means lower service costs.','<p>User-friendly display with “e-Drive” (press and turn control) to recall preset and saved welding settings<br>Constant drive with regulated electronics<br>Using the new VARIMAT V2, polymer roofing membranes can be welded more rapidly resulting in lower cost. Users appreciate its streamlined ergonomics and its ease of use. The clearly laid out operating unit‘s „e-drive“ allows for the control of all relevant welding parameters.</p>',370,'2023-11-21 11:38:34','2023-11-21 11:38:34','فاريمات V2','أقصى سرعة لحام 12 م/دقيقة (حسب المادة).\r\nشريط دليل للتعامل المريح\r\nمنفاخ لا يحتاج إلى صيانة يعني انخفاض تكاليف الخدمة.','<p>باستخدام VARIMAT V2 الجديد، يمكن لحام أغشية الأسقف البوليمرية بسرعة أكبر مما يؤدي إلى انخفاض التكلفة. يقدر المستخدمون بيئة العمل المبسطة وسهولة الاستخدام. يسمح \"المحرك الإلكتروني\" الخاص بوحدة التشغيل الموضحة بوضوح بالتحكم في جميع معلمات اللحام ذات الصلة.</p>'),(202,'Bitumat B2','Flameless welding of modified bitumen.\r\nNo shrinking of the insulation due to integrated air dam.\r\nUniform welding results\r\nHigh working speed','<p>Bitumat B2<br>Flameless welding of modified bitumen.<br>No shrinking of the insulation due to integrated air dam.<br>Uniform welding results<br>High working speed<br>Requires only one user to efficiently weld seams (torch weldingrequires two)<br>Welding of modified bitumen sheeting (SBS, APP) with the flameless BITUMAT B2 is much safer than welding with an open flame. The weld strength is significantly better and the single step process makes welding more economical</p>',370,'2023-11-21 11:40:51','2023-11-21 11:40:51','البيتومات B2','لحام عديم اللهب من البيتومين المعدل.\r\nلا يوجد تقلص في العزل بسبب السد الهوائي المتكامل.\r\nنتائج لحام موحدة\r\nسرعة عمل عالية','<p>البيتومات B2<br>لحام عديم اللهب من البيتومين المعدل.<br>لا يوجد تقلص في العزل بسبب السد الهوائي المتكامل.<br>نتائج لحام موحدة<br>سرعة عمل عالية<br>يتطلب مستخدمًا واحدًا فقط للحام اللحامات بكفاءة (يتطلب اللحام بالشعلة اثنين)<br>يعد لحام صفائح البيتومين المعدلة (SBS، APP) باستخدام مادة BITUMAT B2 عديمة اللهب أكثر أمانًا من اللحام باللهب المكشوف. قوة اللحام أفضل بكثير وعملية الخطوة الواحدة تجعل اللحام أكثر اقتصادا<br>albitumat B2</p>'),(203,'Cube Mould','Cube moulds are used in the preparation of concrete cube specimens of high strength materials for compression testing.','<p>Cube Mould<br>Cube moulds are used in the preparation of concrete cube specimens of high strength materials for compression testing. These concrete moulds are employed to examine the strength of the Concrete, cement and some classes of lime. Cube mould are made in cast iron. Machined surface finished by flat grinding machine.</p>',371,'2023-11-21 11:44:28','2023-11-21 11:44:28','قالب مكعب','تستخدم القوالب المكعبة في تحضير عينات المكعبات الخرسانية من مواد عالية القوة لاختبار الضغط','<p>قالب مكعب<br>تستخدم القوالب المكعبة في تحضير عينات المكعبات الخرسانية من مواد عالية القوة لاختبار الضغط. تستخدم هذه القوالب الخرسانية لفحص قوة الخرسانة والأسمنت وبعض أنواع الجير. قالب المكعب مصنوع من الحديد الزهر. تم الانتهاء من السطح الميكانيكي بواسطة آلة طحن مسطحة.</p>'),(204,'Sieve','Sieve analysis is generally used for monitoring and analysing the grain-size distribution of a prepared sample.','<p>Sieve<br>Sieve analysis is generally used for monitoring and analysing the grain-size distribution of a prepared sample. The particle size distribution is critical to the way a material performs in use. Sieve analysis can be carried out on all types of organic and non-organic granular materials such as sands, clays, coals, crushed 