PEB. وتشمل هذه براغي التثبيت، ومسامير التوصيل، وقضبان الترهل، ومكونات دعامة الكابلات.</p>'),(218,'Hot Rolled Steel Structures (HRSS)','Our hot-rolled steel construction meets our high safety and quality standards.','<p>Hot Rolled Steel Structures (HRSS)<br>Our hot-rolled steel construction meets our high safety and quality standards. It is a cost-effective option for customers in large projects such as multi-story low-rise buildings, oil and gas fields, equipment structures, pipe racks and platforms, petrochemical plants, power plants, conveyor structures, cement plants, shopping malls, etc.</p>',425,'2023-11-23 09:30:07','2023-11-23 09:30:07','الهياكل الفولاذية المدرفلة على الساخن (HRSS)','يلبي هيكلنا الفولاذي المدلفن على الساخن معايير السلامة والجودة العالية لدينا.','<p>الهياكل الفولاذية المدرفلة على الساخن (HRSS)<br>يلبي هيكلنا الفولاذي المدلفن على الساخن معايير السلامة والجودة العالية لدينا. إنه خيار فعال من حيث التكلفة للعملاء في المشاريع الكبيرة مثل المباني منخفضة الارتفاع متعددة الطوابق، وحقول النفط والغاز، وهياكل المعدات، ورفوف الأنابيب والمنصات، ومصانع البتروكيماويات، ومحطات الطاقة، وهياكل النقل، ومصانع الأسمنت، ومراكز التسوق، إلخ</p>'),(219,'STRAND SIZES AND GRADES','We manufacture Low relaxation PC strands in left-hand lay or Right-hand Lay','<p>STRAND SIZES AND GRADES<br>We manufacture Low relaxation PC strands in left-hand lay or Right-hand Lay, in sizes from 9.30 mm up to 17.8 mm, conforming to ASTM A416-18, BS 5896: 2012, and other international standards.</p><p>JSI can supply plain and indented PC strands.</p><p>JSI can supply dry unoiled strands or soluble oiled strands as per customer requirement.&nbsp;<br>&nbsp;</p>',430,'2023-11-23 09:32:37','2023-11-23 09:32:37','أحجام ودرجات ستراند','نقوم بتصنيع خيوط PC منخفضة الاسترخاء في وضع اليد اليسرى أو وضع اليد اليمنى، بأحجام تتراوح من 9.30 ملم إلى 17.8 ملم، بما يتوافق مع ASTM A416-18، وBS 5896: 2012، والمعايير الدولية الأخرى.','<p>أحجام ودرجات ستراند<br>&nbsp;نقوم بتصنيع خيوط PC منخفضة الاسترخاء في وضع اليد اليسرى أو وضع اليد اليمنى، بأحجام تتراوح من 9.30 ملم إلى 17.8 ملم، بما يتوافق مع ASTM A416-18، وBS 5896: 2012، والمعايير الدولية الأخرى.</p><p>&nbsp;يمكن لـ JSI توفير خيوط PC عادية ومتباعدة.</p><p>&nbsp;يمكن لشركة JSI توفير خيوط جافة غير مزيتة أو خيوط مزيتة قابلة للذوبان حسب متطلبات العميل.</p>'),(220,'PACKAGING OF COILS','To ensure sea-worthy packaging, each coil is wrapped with 2 layers of packing materials VCI and Poly/stretch film rolls on an automatic wrapping machine.','<p>To ensure sea-worthy packaging, each coil is wrapped with 2 layers of packing materials VCI and Poly/stretch film rolls on an automatic wrapping machine. VCI rolls are HDPE woven mesh with paper wrapping rolls with vapor corrosion inhibitor and it provides protection against corrosion. A layer of Plain poly/ stretch film rolls provides additional abrasion resistance. Stretch film is wrapped for additional resistance to moisture. Each coil is fitted with full width Poly sheet for additional protection.&nbsp;</p>',430,'2023-11-23 09:35:26','2023-11-23 09:35:26',NULL,NULL,NULL),(221,'Mixer','Engine OM460 - Euro III\r\nTransmission G 260-16/11.7-0.69\r\nFront axles spring. 2 x 8,0 t, 3-leaf\r\nRear axle spring, 2 x 16.0 t\r\nCabin S-cab ClassicSpace, 2.30 m\r\nFront axle 8.0 t\r\nFront axle, straight version','<p>Engine OM460 - Euro III<br>Transmission G 260-16/11.7-0.69<br>Front axles spring. 2 x 8,0 t, 3-leaf<br>Rear axle spring, 2 x 16.0 t<br>Cabin S-cab ClassicSpace, 2.30 m<br>Front axle 8.0 t<br>Front axle, straight version<br>Rear axle, crown wheel 300, planetary, 13.4 t<br>Axle ratio i = 4.333<br>Electronic braking system with ABS and ASR<br>ABS, disengageable<br>Disc brakes on front and rear axle<br>Condensation sensor, for compressed-air system<br>Frame overhang, 1300 mm<br>Wheelbase 5150 mm<br>Steering, Servotwin<br>Power steering pump, uncontrolled</p>',438,'2023-11-23 10:00:37','2023-11-23 10:00:37','خلاط','المحرك OM460 - اليورو III\r\nناقل الحركة G 260-16/11.7-0.69\r\nالمحاور ال