55 R 22,5<br>حواف العجلات 15 درجة حواف مدببة 11.75 × 22.5 المحور الأمامي<br>المحور الخلفي: المحاور عجلة تاج المحور الخلفي 440 هيبويد 13.0 طن</p>'),(225,'mixer','Oshkosh-McNeilus is one of the innovative leaders in the world for the supply and sales of all types of concrete transit mixers.','<p>Oshkosh-McNeilus is one of the innovative leaders in the world for the supply and sales of all types of concrete transit mixers.<br>From 7m up to 12m cubed mixer bodies for fitment to the preferred chassis of our client’s choice. It can be supplied as a mixer only or a complete truck with safety equipment systems.</p>',449,'2023-11-23 11:31:21','2023-11-23 11:31:21','خلاط','تُعد شركة Oshkosh-McNeilus واحدة من الشركات الرائدة المبتكرة في العالم في مجال توريد وبيع جميع أنواع خلاطات الخرسانة العابرة.','<p>خلاط<br>تُعد شركة Oshkosh-McNeilus واحدة من الشركات الرائدة المبتكرة في العالم في مجال توريد وبيع جميع أنواع خلاطات الخرسانة العابرة.<br>من 7 أمتار إلى 12 مترًا من أجسام الخلاط المكعبة للتركيب على الهيكل المفضل الذي يختاره عملائنا. ويمكن توفيره كخلاط فقط أو شاحنة كاملة مزودة بأنظمة معدات السلامة.</p><p>تلتزم شركة McNeilus Mixers بمزج الابتكار مع الجودة في كل ما تنتجه. إنها تصمم باستمرار تطورات جديدة في خلاطاتها وابتكاراتها.<br>يعد التأكد من أن السلامة عاملاً مهمًا لكل من مشغل الخلاط ومهندسي الموقع وفي نفس الوقت حماية البيئة.</p>'),(226,'TerexCranes','Rise above the rest with our #TerexCranes. Whatever your lifting needs may be, we\'ve got the perfect solution for you','<p>TerexCranes<br>Rise above the rest with our #TerexCranes. Whatever your lifting needs may be, we\'ve got the perfect solution for you. Reach new heights of efficiency and reliability.</p>',450,'2023-11-23 11:41:10','2023-11-23 11:41:10','رافعات تيريكس','رافعات تيريكس\r\nارتقِ فوق الجميع مع #رافعات_Terex الخاصة بنا. مهما كانت احتياجات الرفع الخاصة بك، فلدينا الحل الأمثل لك.','<p>رافعات تيريكس<br>ارتقِ فوق الجميع مع #رافعات_Terex الخاصة بنا. مهما كانت احتياجات الرفع الخاصة بك، فلدينا الحل الأمثل لك. الوصول إلى آفاق جديدة من الكفاءة والموثوقية.</p>'),(227,'Concrete pump','concrete pumping maintenance can:\r\n1) Extend the service Lifetime\r\n2) Avoid Concrete Pumping accidents','<p>Concrete pump<br>Why you should do Concrete pump preventative maintenance?<br>concrete pumping maintenance can:<br>1) Extend the service Lifetime<br>2) Avoid Concrete Pumping accidents<br>3) Maintain Efficient Performance</p>',449,'2023-11-23 11:45:52','2023-11-23 11:45:52','مضخة الخرسانة','يمكن لصيانة ضخ الخرسانة:\r\n1) تمديد عمر الخدمة\r\n2) تجنب حوادث ضخ الخرسانة','<p>مضخة الخرسانة<br>لماذا يجب عليك القيام بالصيانة الوقائية لمضخة الخرسانة؟<br>يمكن لصيانة ضخ الخرسانة:<br>1) تمديد عمر الخدمة<br>2) تجنب حوادث ضخ الخرسانة<br>3) الحفاظ على الأداء الفعال</p>'),(228,'Floor insulation','Floor insulation in intermediate floor acts as sound barrier preventing impact sound from being transmitted to other parts of the building','<p>Floor insulation in intermediate floor acts as sound barrier preventing impact sound from being transmitted to other parts of the building&nbsp;<br>&nbsp;</p>',453,'2023-11-23 12:21:48','2023-11-23 12:21:48','عزل الأرضيات','يعمل عزل الأرضيات في الأرضية المتوسطة كحاجز صوتي يمنع انتقال الصوت الناتج عن الارتطام إلى أجزاء أخرى من المبنى','<p>يعمل عزل الأرضيات في الأرضية المتوسطة كحاجز صوتي يمنع انتقال الصوت الناتج عن الارتطام إلى أجزاء أخرى من المبنى</p>'),(229,'ETHICS','ETHICS is one of the most efficient systems to insulate external walls (new or renovated) to offer improved thermal and acoustic comfort.','<p>ETHICS is one of the most efficient systems to insulate external walls (new or renovated) to offer improved thermal and acoustic comfort.</p>',454,'2023-11-23 12:23:58','2023-11-23 12:23:58','ETHICS','تعد ETHICS واحدة من أكثر الأنظمة كفاءة لعزل الجدران الخارجية (الجديدة أو المجددة) لتوفير راحة حرارية وصوتية محسنة.','<p>تعد ETHICS واحدة من أكثر الأنظمة كفاءة لعزل الجدران الخارجية (الجديدة أو المجددة) لتوفير راحة حرارية وصوتية محسنة.</p>'),(230,'SABIC rebar','Discover SABIC Rebar, the high-quality, reliable building material that underpins Saudi Arabia\'s multi-prosperity','<p>SABIC rebar<br>Discover SABIC Rebar, the high-quality, reliable building material that underpins Saudi Arabia\'s multi-prosperity. The rebar is finished in accordance with international law, providing strength and stability to various structures.</p>',458,'2023-11-23 12:53:26','2023-11-23 12:53:26','حديد تسليح سابك','اكتشف حديد التسليح من سابك، مواد البناء عالية الجودة والموثوقة والتي أسست الازدهار في المملكة العربية السعودية السعودية المتعددة.','<p>حديد تسليح سابك<br>اكتشف حديد التسليح من سابك، مواد البناء عالية الجودة والموثوقة والتي أسست الازدهار في المملكة العربية السعودية السعودية المتعددة. تم الانتهاء من حديد التسليح وفقًا للقانون الدولي، مما يوفر القوة والثبات للهياكل المتنوعة.</p>'),(231,'Steel Shafting','Madar Building Materials offers Steel Shafting Bars with high-quality steel for exceptional strength and stability.','<p>Madar Building Materials offers Steel Shafting Bars with high-quality steel for exceptional strength and stability.<br>Available in a range of diameters and lengths for construction, manufacturing and more.</p>',458,'2023-11-23 12:57:19','2023-11-23 12:57:19','قضبان أعمدة فولاذية','توفر مدار لمواد البناء قضبان أعمدة فولاذية ذات جودة عالية من الفولاذ لتحقيق قوة وثبات استثنائيين.','<p>توفر مدار لمواد البناء قضبان أعمدة فولاذية ذات جودة عالية من الفولاذ لتحقيق قوة وثبات استثنائيين.<br>متوفر في مجموعة من الأقطار والأطوال للبناء والتصنيع والمزيد.</p>'),(232,'Izomaks MC1','Izomaks MC1 is a high-quality medium-curing cut-back asphalt designed for road construction and maintenance.','<p>Izomaks MC1 is a high-quality medium-curing cut-back asphalt designed for road construction and maintenance. It is easy to apply, cures quickly and provides excellent adhesion, durability, and water resistance. Suitable for use in areas with high rainfall. Available in 200-liter containers.</p>',459,'2023-11-23 13:09:08','2023-11-23 13:09:08','ايزوماكس ام سي 1','Izomaks MC1 عبارة عن أسفلت مقطوع عالي الجودة ومتوسط المعالجة مصمم لبناء الطرق وصيانتها','<p>ايزوماكس ام سي 1<br>Izomaks MC1 عبارة عن أسفلت مقطوع عالي الجودة ومتوسط المعالجة مصمم لبناء الطرق وصيانتها. إنه سهل التطبيق ويعالج بسرعة ويوفر التصاقًا ممتازًا ومتانة ومقاومة للماء. مناسبة للاستخدام في المناطق ذات الأمطار الغزيرة. متوفر في عبوات سعة 200 لتر.</p>'),(233,'Black cement','Aqada Building Materials offers a wide range of basic cement blocks for various infrastructure.','<p>Black cement Aqada Building Materials offers a wide range of basic cement blocks for various infrastructure. Our cement blocks are strong and durable, free from fire and working conditions. They are cost effective and easy to install, making them an ideal choice for your next project.</p>',459,'2023-11-23 13:11:36','2023-11-23 13:11:36','بلاك اسمنتي','تقدم قدما لمواد البناء مجموعة كبيرة من الكتل الأسمنتية الأساسية للبنية الأساسية المختلفة.','<p>بلاك اسمنتي<br>تقدم قدما لمواد البناء مجموعة كبيرة من الكتل الأسمنتية الأساسية للبنية الأساسية المختلفة. بلوكاتنا الأسمنتية قوية ومتينة حرية وحريق وظروف العمل. إنها فعالة من حيث التكلفة والتركيب، مما يجعلها خيارًا مثاليًا للمشروع التالي.</p>');
