INSERT INTO `user_ideas` VALUES (21,'kitchen project','No matter your budget, tastes, or existing layout, our team of experienced designers and curated materials library will help you create a space that’s truly your own.',39,'2023-10-29 08:52:41','2023-10-29 08:52:41','مشروع مطبخ','بغض النظر عن ميزانيتك أو أذواقك أو تخطيطك الحالي، سيساعدك فريقنا من المصممين ذوي الخبرة ومكتبة المواد المنسقة على إنشاء مساحة خاصة بك حقًا.'),(22,'office','A journey down memory lane, well aware and knowing just how to answer to the styles, practicality, and needs of contemporary living.',41,'2023-10-30 11:37:44','2023-10-30 11:37:44','مكتب','رحلة عبر حارة الذاكرة، تدرك جيدًا وتعرف كيفية الاستجابة لأساليب الحياة المعاصرة والتطبيق العملي واحتياجاتها.'),(41,'LAVISH PROFUNDITY','Palm Hills - Sheikh Zayed I 2021       Giza, Egypt The residence is designed to be a deep spectacle of grand statements thanks to the selection of sculptures and accentuation of luxurious materials.',190,'2023-11-06 09:19:54','2023-11-21 10:08:41','العمق الفخم','بالم هيلز - الشيخ زايد الأول 2021 الجيزة، مصر تم تصميم السكن ليكون بمثابة مشهد عميق من البيانات الكبرى بفضل مجموعة مختارة من المنحوتات وإبراز المواد الفاخرة. التوازن بين التطبيق العملي والأناقة والراحة؛ \"العمق الفخم\" هو انعكاس ناضج لمساحة فاخرة من التأمل والروعة الفنية.'),(42,'meeting rooms','Paymob H.Q. A space designed to showcase the rapid force in which Paymob operates, The Arrow drives the innovation within.',191,'2023-11-06 09:50:08','2023-11-06 09:50:08','غرف الإجتماعات','المقر الرئيسي لشركة Paymob. مساحة مصممة لعرض القوة السريعة التي تعمل فيها Paymob، السهم الذي يدفع الابتكار في الداخل.'),(43,'Meeting Room','KIJAMII H.Q. The tree branches in lightly, to connect the inside core, heart, and rooms with the outside yet secluded. Featuring the wood modules in furniture keeps the interior minimal, calm, and elegant.',191,'2023-11-06 09:52:29','2023-11-06 09:52:29','غرفة الإجتماعات','المقر الرئيسي لكيجامي تتفرع الشجرة بشكل خفيف لتربط اللب الداخلي والقلب والغرف بالخارج ولكن منعزلة. إن استخدام الوحدات الخشبية في الأثاث يحافظ على التصميم الداخلي بسيطًا وهادئًا وأنيقًا.'),(44,'Building in Sadat City','An exterior design for a building in Sadat City Whatever your taste is, we can design it for you.',193,'2023-11-06 10:09:46','2023-11-06 10:09:46','مبنى بمدينة السادات','تصميم خارجي لمبنى بمدينة السادات مهما كان ذوقك، يمكننا تصميمه لك.'),(45,'El-Ghamidi villa','El-Ghamidi villa is located in Saudi Arabia with 450 sq.m. The client requested a modern design with a specific zoning to serve his family needs with a comfy life experience.',194,'2023-11-06 10:18:39','2023-11-06 10:18:39','فيلا الغامدي','تقع فيلا الغامدي في المملكة العربية السعودية بمساحة 450 متر مربع. طلب العميل تصميمًا عصريًا بتقسيمات محددة لخدمة احتياجات أسرته وتجربة حياة مريحة'),(46,'SARAI RESIDENTIAL COMPOUND','SARAI RESIDENTIAL COMPOUND  CLIENT: NASR CITY HOUSING & DEVELOPMENT LOCATION: NEW CAIRO, EGYPT',196,'2023-11-06 10:49:27','2023-11-06 10:49:27','مجمع سراي السكني','مجمع سراي السكني العميل: مدينة نصر للإسكان والتعمير الموقع: القاهرة الجديدة، مصر'),(47,'UPTOWN VILLA','A vestige of the landscape and the relationship shared between the residence and site, the house takes full advantage of the plot’s mild climate. While windows and doors fill interiors with air and light, they also frame views of the diverse flora surrounding the home.',202,'2023-11-06 11:55:37','2023-11-06 11:55:37','أبتاون فيلا','من بقايا المناظر الطبيعية والعلاقة المشتركة بين السكن والموقع، يستفيد المنزل استفادة كاملة من المناخ المعتدل في قطعة الأرض. في حين أن النوافذ والأبواب تملأ الديكورات الداخلية بالهواء والضوء، فإنها توفر أيضًا إطلالة على النباتات المتنوعة المحيطة بالمنزل.'),(48,'LAKE VIEW VILLA','Clarity and simplicity of mind is the goal of this design approach. No excess, only perfection. An exquisite meld of old and new, the main reception area is tucked away behind the glowing marble staircase, and its brassy separator bars. With dangling crystal chandeliers and sublime wainscoting lining pristine white walls, an aged look makes a timeless return. The chandelier is reinvented and reinterpreted, taking it back to its original roots in nature.',199,'2023-11-06 12:04:18','2023-11-06 12:04:18','فيلا تطل على البحيرة','الوضوح وبساطة العقل هو الهدف من نهج التصميم هذا. لا فائض، فقط الكمال. مزيج رائع بين القديم والجديد، تقع منطقة الاستقبال الرئيسية بعيدًا خلف الدرج الرخامي المتوهج والقضبان النحاسية الفاصلة. مع الثريات الكريستالية المتدلية والجدران البيضاء الرائعة المبطنة بالخشب، يعود المظهر القديم إلى الأبد. تم إعادة اختراع الثريا وإعادة تصميمها، مما أعادها إلى جذورها الأصلية في الطبيعة.'),(49,'Kheyam Tower','The award-winning structure is designed to maximize views and minimize solar heat loads. Its unique sculptural form was generated through an algorithmic design process.',221,'2023-11-07 09:58:45','2023-11-07 09:58:45','برج الخيام','تم تصميم الهيكل الحائز على جائزة لتحقيق أقصى قدر من المناظر وتقليل الأحمال الحرارية الشمسية. تم إنشاء شكله النحتي الفريد من خلال عملية تصميم خوارزمية.'),(50,NULL,NULL,225,'2023-11-07 10:31:52','2023-11-07 10:31:52','غلاية الفئة X من اريستون','اختار الراحة والأمان مع غلاية Class X من Ariston، التي تتميز بخاصيةOver Heating Protection والمسؤولة عن فصل الغاز عند ارتفاع درجة الحرارة عن الدرجه المحدده. - تأتي الغلاية بشاشة LCD لسهولة التحكم والتنبيه في حالة وجود أي عطل.'),(51,'HITACHI Mini VRF','HITACHI Mini VRF\'s dynamic adaptability for every application. Our HITACHI Mini VRF system redefines versatility,  ensuring optimal comfort and energy efficiency.  It seamlessly integrates into your environment,  serving multiple purposes and transforming the way you experience climate control.',227,'2023-11-07 10:55:46','2023-11-07 10:55:46','HITACHI Mini VRF','قدرة HITACHI Mini VRF على التكيف الديناميكي مع كل تطبيق.'),(52,'SHARP ELEGANT','Private villa .. Rehab City',228,'2023-11-07 11:04:39','2023-11-07 11:04:39','أنيق و حاد','فيلا خاصة .. مدينة الرحاب'),(53,'The Crystal City','The Crystal City is the conceptual idea for a re