is piece of art is made of solid brass and hand-crafted by talented artisans and is not off-the-shelf machine made items.   This amazing Lighting Fixture will add a cool touch to your Dinning Room or bed room and would match with your existing home decor. It is a perfect lighting decor for restaurants wanting to offer decorative pendant lighting for a romantic mood. This Moroccan Lamp is meant to hang anywhere in your home.  Our quality control system promises that all Moroccan lamps we produce are always of best quality!  Matching ceiling plate included , 2 ft of chain and wire included Accommodates one bulb of E26 base , Max Wattage: 100w Hardwired, ready to be installed , UL Listed.   Handcrafted  Decoration Style: Moroccan, Boho, Turkish, Farmhouse Material : Solid Brass Available Colors : Silver, Gold, Black, Bronze Lighting Style : Pendant Lamp, Lighting Fixture, Chandelier Suitable for : Dining Room, Living room, Bedroom, Kitchen, Kitchen Island, Entryway , Hallway, Foyer, Porch Interior Design : Residential, Commercial',313,'2023-11-20 09:23:22','2023-11-20 09:23:22',NULL,NULL),(71,'Unique handcrafted wood Syrian Table','Unique handcrafted wood Syrian Table  it is amazing the details in the top and the work in the sides  Made of high quality solid beech wood  Many hours of work were dedicated to handicraft this piece of art  Inlaid with different kind of wood  Measures: 25\" (64 cm) height and 10\" (27 cm) Wide  I ship all my items from Egypt; please allow up to 10 days for delivery  Please email me for any questions  A Syrian marquetry table is a table that is decorated with marquetry, a decorative technique in which pieces of wood or other materials are inlaid into a surface to create elaborate designs. Syrian marquetry tables are typically made of walnut wood and are decorated with geometric patterns, floral motifs, and Arabic calligraphy. Mother-of-pearl is often used to accent the designs, adding a touch of luxury and sophistication.  The marquetry designs on Syrian marquetry tables are often complex and symbolic. Geometric patterns are said to represent the order and beauty of the universe, while floral motifs represent the abundance of life. Arabic calligraphy is often used to inscribe verses from the Quran or other religious texts.  Syrian marquetry tables are truly works of art. They are a testament to the rich cultural heritage of Syria and the skill of its craftsmen.',313,'2023-11-20 09:28:36','2023-11-20 09:28:36','طاولة سورية مصنوعة يدوياً من الخشب الفريد','طاولة سورية مصنوعة يدوياً من الخشب الفريد  إنه لأمر مدهش التفاصيل في الأعلى والعمل في الجوانب  مصنوع من خشب الزان الصلب عالي الجودة  تم تخصيص ساعات طويلة من العمل لصناعة هذه القطعة الفنية يدويًا  مطعمة بأنواع مختلفة من الخشب  المقاسات: الارتفاع 25 بوصة (64 سم) والعرض 10 بوصة (27 سم).  أقوم بشحن جميع أشيائي من مصر؛ يرجى السماح بما يصل إلى 10 أيام للتسليم  يرجى البريد الالكتروني لي عن أي أسئلة  طاولة المطعمة السورية هي طاولة مزينة بالتطعيم، وهي تقنية زخرفية يتم فيها تطعيم قطع من الخشب أو مواد أخرى على السطح لإنشاء تصميمات متقنة. عادة ما تكون الطاولات المطعمة السورية مصنوعة من خشب الجوز ومزينة بأنماط هندسية وزخارف نباتية والخط العربي. غالبًا ما يتم استخدام عرق اللؤلؤ لإبراز التصاميم، مما يضيف لمسة من الفخامة والرقي.  غالباً ما تكون التصاميم المطعمة على طاولات المطعمة السورية معقدة ورمزية. يقال إن الأنماط الهندسية تمثل نظام الكون وجماله، بينما تمثل الزخارف الزهرية وفرة الحياة. غالبًا ما يستخدم الخط العربي لكتابة آيات من القرآن أو النصوص الدينية الأخرى.  تعتبر طاولات المطعمة السورية أعمالاً فنية حقيقية. إنها شهادة على التراث الثقافي الغني لسوريا ومهارة الحرفيين.'),(72,'Moroccan Ceiling Light Fixture','Moroccan Ceiling Light Fixture:  A stunning Moroccan style hand-made ceiling light fixture- pendant lamp chandelier is designed to enhance the exotic beauty of your home decor.     This Moroccan ceiling light fixture chandelier is made of high quality brass with antique gold finish.  Many hours of work were dedicated to hand craft this beautiful light. It can b