MMAM - KSA is coming to reality. one of the most challenges the architect face is how to translate his vision and ideas to reality by creating the process that allows the intangible aspects to become tangible elements, this is the beauty and the power of architecture. S -SQAURE completion progress is 30 % the iconic project will reach its final phase soon',451,'2023-11-23 12:00:21','2023-11-23 12:00:21','S-SQUARE','S-SQUARE مشروعنا S-SQUARE الموجود في الدمام - المملكة العربية السعودية أصبح حقيقة. من أكثر التحديات التي يواجهها المهندس المعماري هي كيفية ترجمة رؤيته وأفكاره إلى واقع من خلال خلق العملية التي تسمح للجوانب غير الملموسة بأن تصبح عناصر ملموسة، هذا هو جمال وقوة العمارة. وصلت نسبة التقدم في إنجاز S-SQAURE إلى 30%، وسيصل المشروع الشهير إلى مرحلته النهائية قريبًا'),(163,'AL MUHAIDIB DOWN SYNDROME','We are thrilled to announce the official opening of the AL MUHAIDIB DOWN SYNDROME educational center in Al khobar ksa it is considered one of the first comprehensive educational center found in the middle east it was a journey full of challenges ups and down but finally we are proud to be a part of this important massage and such a unique projects',452,'2023-11-23 12:11:24','2023-11-23 12:11:24','مركز المهيدب لمتلازمة داون التعليمي','يسعدنا أن نعلن عن الافتتاح الرسمي لمركز المهيدب لمتلازمة داون التعليمي في الخبر بالمملكة العربية السعودية، فهو يعتبر من أول المراكز التعليمية الشاملة الموجودة في الشرق الأوسط، لقد كانت رحلة مليئة بالتحديات صعودًا وهبوطًا ولكن في النهاية نحن فخورون لتكون جزءًا من هذا التدليك المهم ومثل هذه المشاريع الفريدة'),(164,'International restaurant','International restaurant A tourist restaurant inside a 5-star hotel Location: Kingdom of Saudi Arabia Designing decorative works in addition to displaying them with high-quality 3D perspectives Location: Amman The project area 986 square meters A large design project and a small villa next to it, each villa has two floors, with all advertising design work completed.',455,'2023-11-23 12:31:56','2023-11-